class Solution {
    func distributeCandies(_ n: Int, _ limit: Int) -> Int {
        var memo = Array(repeating: Array(repeating: -1, count: limit + 1), count: n + 1)

        func ways(_ candies: Int, _ maxLimit: Int) -> Int {
            if candies == 0 {
                return 1
            }
            if maxLimit == 0 {
                return 0
            }
            if memo[candies][maxLimit] != -1 {
                return memo[candies][maxLimit]
            }

            var result = 0
            for i in 0...min(candies, maxLimit) {
                result += ways(candies - i, min(maxLimit, i))
            }
            memo[candies][maxLimit] = result
            return result
        }

        return ways(n, limit)
    }
}
